<?php

namespace lulo\tests;

use \lulo\tests\models\Photo as Photo;
use \lulo\tests\models\Post as Post;
use \lulo\tests\models\User as User;
use \lulo\tests\models\Tag as Tag;

/**
 * Tests for Lulo.
 *  */
class Tester{
	
	/**
	 * Database initialization.
	 * 	 */
	public static function init_db(){
		\lulo\management\Manager::createTables(User::CLASS_NAME);
		\lulo\management\Manager::createTables(Tag::CLASS_NAME);
		\lulo\management\Manager::createTables(Photo::CLASS_NAME);
		\lulo\management\Manager::createTables(Post::CLASS_NAME);
	}
	
	
	/**
	 * Database deletion.
	 * 	 */	
	public static function delete_db(){
		\lulo\management\Manager::dropTables(User::CLASS_NAME);
		\lulo\management\Manager::dropTables(Tag::CLASS_NAME);
		\lulo\management\Manager::dropTables(Photo::CLASS_NAME);
		\lulo\management\Manager::dropTables(Post::CLASS_NAME);
	}
	
	
	/**
	 * Get an unique suffix. Used to make unique names for objects.
	 * 	 */
	protected static function create_unique_suffix(){
		return uniqid(rand());
	}
	
	
	/**
	 * Create a default user
	 * */
	protected static function create_default_user($userData=null){
		// Default photo in base64
		$fotoBase64 = "";
		
		// PNG file in /tmp/<timestamp>.png
		$timestamp = "user_".static::create_unique_suffix();
		$filename = "/tmp/{$timestamp}.jpg";
		file_put_contents($filename, base64_decode($fotoBase64));
		
		$photo = fopen("/tmp/{$timestamp}.jpg", "r");
		
		if(is_null($userData)){
			$suffix = rand();
			$userData = [
				"first_name"=>"Nombre_{$suffix}",
				"last_name"=>"Apellido_{$suffix}",
				"email"=>"Email_{$suffix}",
				"username"=>"Username_{$suffix}",
				"phone"=>"Phone_{$suffix}",
				"password"=>"Password_{$suffix}",
				"main_photo"=>$photo,
			];
		}
		
		// User creation
		$cleanedUserData = User::cleanCreation($userData);
		$user = User::factoryFromArray($cleanedUserData);
		$user->dbSave(["main_photo"=>$photo]);
		fclose($photo);
		return $user;
	}

	
	/**
	 * Tests for SELECT.
	 * 	 */
	public static function select_tests(){
		print "Tests with SELECT<br>";
		
		$user1 = static::create_default_user($userData=null);
		$user2 = static::create_default_user($userData=null);
		$user3 = static::create_default_user($userData=null);
		
		// Two first users
		$users = User::objects()->limit(2)->order(["id" => "desc"]);
		if($users[0]->id == $user3->id and $users[1]->id == $user2->id){
			print "- 2  last users ({$users[0]} y {$users[1]}) has been created sucessfully and they're right. SUCCESS.<br>";
		}else{
			print "- Error when selection last two users. ERROR:<br>";
		}
		
		// Obtención de los usuarios cuyo apellido está en una lista
		$presentFirstName = "José_".static::create_unique_suffix();
		$presentLastName = "Pérez_".static::create_unique_suffix();
		$notPresentLastName = "Gómez_".static::create_unique_suffix();
		$user1->first_name = $presentFirstName;
		$user1->last_name = $presentLastName;
		$user1->dbSave();
		$user2->last_name = $presentLastName;
		$user2->dbSave();
		
		$searchedLastNames = [$presentLastName, $notPresentLastName];
		$users_apellidos = User::objects()
			->filter([["last_name__in"=>$searchedLastNames],["first_name"=>$presentFirstName]])
			->order(["id" => "asc"]);
		
		if(($users_apellidos[0]->id == $user1->id and $users_apellidos[1]->id == $user2->id) or
		($users_apellidos[0]->id == $user2->id and $users_apellidos[1]->id == $user1->id)){
			print "- Complex selection query has been a SUCCESS <br/>";
		}else{
			print "- Complex selection query has been an ERROR <br/>";
		}
		
		// Eliminación de los usuarios creados
		$user1->dbDelete();
		$user2->dbDelete();
		$user3->dbDelete();
		
		print "END SELECT TESTS<br><br>";
	}
	
	
	/**
	 * Tests for COUNT.
	 * 	 */
	public static function count_tests(){
		print "Tests for COUNT<br>";

		$user1 = static::create_default_user($userData=null);
		$user2 = static::create_default_user($userData=null);
		$user3 = static::create_default_user($userData=null);
		
		$notPresentLastName = "XXXXXXXXX_".static::create_unique_suffix()."_".static::create_unique_suffix()."_XXXXXXXXX";
		
		$presentFirstName = "Helena_".static::create_unique_suffix();
		$presentLastName = "Arta_".static::create_unique_suffix();
		$user1->first_name = $presentFirstName;
		$user2->last_name = $presentLastName;
		$user3->last_name = $presentLastName;
		
		$user1->dbSave();
		$user2->dbSave();
		$user3->dbSave();
		
		// Count of users that have a surname equal to $presentLastName. Should be 2.
		$countUserPresentLastName = User::objects()->filter(["last_name"=>$presentLastName])->count();
		if($countUserPresentLastName == 2){
			print "- Two users with surname {$presentLastName}. SUCCESS.<br>";
		}else{
			print "- There are no two users with surname {$presentLastName}. ERROR.<br>";
		}
		
		// Users with surname $notPresentLastName. Should be 0.
		$countUserNotPresentLastName = User::objects()->filter(["last_name"=>$notPresentLastName])->count();
		if($countUserNotPresentLastName == 0){
			print "- There are 0 users with surname {$notPresentLastName}. SUCCESS.<br>";
		}else{
			print "- Error, there are {$countUserNotPresentLastName} users with surname {$notPresentLastName}. ERROR.<br>";
		}
		
	
		// Number of objects with surname = $presentLastName or name = $presentFirstName. Should be 3.
		$countUserPresentName = User::objects()->filter(["last_name"=>$presentLastName], ["first_name"=>$presentFirstName])->count();
		if($countUserPresentName == 3){
			print "- There are 3 users with surname {$presentLastName} or with the name {$presentFirstName}. SUCCESS.<br>";
		}else{
			print "- Error, there are not 3 users with surname {$presentLastName} or with the name {$presentFirstName}. ERROR.<br>";
		}

		// Delete all created users
		$user1->dbDelete();
		$user2->dbDelete();
		$user3->dbDelete();
		
		print "END tests for COUNT<br><br>";
	}
	
	
	/**
	 * Tests para la operación DELETE.
	 * 	 */
	public static function delete_tests(){
		print "Tests sobre DELETE<br>";
		
		// Create some users
		$user1 = static::create_default_user($userData=null);
		$user2 = static::create_default_user($userData=null);
		$user3 = static::create_default_user($userData=null);

		// Query users
		$createdUsers = User::objects()->filter(["first_name" => $user1->first_name], ["first_name" => $user2->first_name], ["first_name" => $user3->first_name]);
		$countUsers = $createdUsers->count();
		if($countUsers==3){
			print "- Querying users was a SUCCESS<br>";
		}else{
			print "- Querying users was an ERROR<br>";
		}
		
		// Delete all users
		$createdUsers->delete();
		
		$oldUsers = User::objects()->filter(["first_name" => $user1->first_name], ["first_name" => $user2->first_name], ["first_name" => $user3->first_name]);
		$countOldUsers = $oldUsers->count();
		if($countOldUsers==0){
			print "- Delete was 100% a SUCCESS<br>";
		}else{
			print "- Delete failed. ERROR<br>";
		}
		
		print "END tests for DELETE<br><br>";
	}
	
	
	/**
	 * Tests for UPDATE.
	 * 	 */
	public static function update_tests(){
		print "Tests for UPDATE<br>";
		
		// Create temporal user
		$user1 = static::create_default_user($userData=null);
		
		// Update users whose name contains Pru and set their names equal to their surnames
		$users = User::objects()->filter(["first_name__contains" => $user1->first_name]);
		$users->update(["first_name" => \lulo\query\TupleValue::n("last_name")]);
		
		// Count of users that have not been modified
		$countFirstName = User::objects()->filter(["first_name__contains" => $user1->first_name])->count();
		if($countFirstName == 0){
			print "- All users were updated correctly. SUCCESS.<br>";
		}else{
			print "- There are some users that where not modified. ERROR.<br>";
		}
		
		// Count users whose name is also their surname
		$countLastName = User::objects()->filter(["first_name__contains" => $user1->last_name])->count();
		if($countLastName == 1){
			print "- There is 1 object with the same name and surname. SUCCESS.<br>";
		}else{
			print "- There is more than one user with the same name and surname. ERROR.<br>";
		}
		
		// Delete the user
		$user1->dbDelete();
		
		print "END of UPDATE<br/><br/>";
	}
	
	
	/**
	 * Tests para la operación INSERT.
	 * 	 */
	public static function insert_tests(){
		print "Tests for INSERT<br/>";			
		// Creation of Tag
		$name = "TestTagName";
		$description = "Unique description".static::create_unique_suffix();
		$tagData = ["name"=>$name, "description"=>$description];
		$tagCleanedData = Tag::cleanCreation($tagData);
		$tag = Tag::factoryFromArray($tagCleanedData);
		$tag->dbSave();
                
		// It should exist
		$savedTag = Tag::objects()->filter($tagData)->get();
		if($savedTag->name == $name and $savedTag->description==$description){
			print "- Creation of {$savedTag} was a SUCCESS<br>";
		}else{
			print "- Creacion of tag was an ERROR<br>";
		}
	
		// Update the tag
		$newDescription = "New unique description ".static::create_unique_suffix();
		$tag->description = $newDescription;
		$tag->dbSave();
		
		// Test if tag exists after update
		$tagDataAfterEdition = ["name"=>$name, "description"=>$newDescription];
		$savedTagAfterEdition = Tag::objects()->filter($tagDataAfterEdition)->get();
		if($savedTagAfterEdition->name == $name and $savedTagAfterEdition->description==$newDescription){
			print "- Edition of {$savedTagAfterEdition} was a SUCCESS<br>";
		}else{
			print "- Different data, ERROR<br>";
		}
		
		// Delete the tag
		$tag->dbDelete();
		
		// Get the deleted tag, should thrown an exception
		$exceptionThrowed = false;
		try{
			Tag::objects()->filter($tagData)->get();
		}catch(\Exception $e){
			print "- After the delete, there is no Tag object SUCCESS.'<br/>";
			$exceptionThrowed = true;
		}
		
		if(!$exceptionThrowed){
			print "- After the delete, Tag still exists. ERROR.'<br/>";
		}
		
		// Count of tag objects
		if(Tag::objects()->filter($tagData)->count() == 0){
			print "- After delete, the count of objects that match the deleted object is 0. SUCCESS<br>";
		}else{
			print "- After deletion of the tag it remains in the table, ERROR<br>";
		}
		
		print "END tests for INSERT<br/><br/>";
	}
	
	
	/**
	 * Blob operations.
	 * 	 */
	public static function blob_tests(){
		print "Tests for BLOBS<br>";		
		
		// Create a temporal user
		$user = static::create_default_user($userData=null);

		// Test photo
		$foto1Base64 = "";
		
		// Creation of a PNG  in /tmp/<timestamp>.png
		$timestamp = "user_photo_".static::create_unique_suffix();
		file_put_contents("/tmp/{$timestamp}.jpg", base64_decode($foto1Base64));
		
		// Creation of user photo
		$photo = fopen("/tmp/{$timestamp}.jpg", "r");
		$photoData = ["photo"=>$photo, "order_in_gallery"=>1, "user"=>$user];
		$cleanedPhotoData = Photo::cleanCreation($photoData);
		$userPhoto = Photo::factoryFromArray($cleanedPhotoData);
		$userPhoto->dbSave(["photo"=>$photo]);
		
		// Test if photo is right
		$userPhotoString = base64_encode($userPhoto->dbBlobLoad("photo"));
		if($userPhotoString == $foto1Base64){
			print "- User {$user} photo  created with SUCCESS<br>";
		}else{
			print "- User {$user} photo  created with ERROR<br>";
		}
		
		// Photograpy edition
		$foto2Base64 = "";
		$timestamp2 = "user_photo_".static::create_unique_suffix();
		file_put_contents("/tmp/{$timestamp2}.jpg", base64_decode($foto2Base64));
		$photo2 = fopen("/tmp/{$timestamp2}.jpg", "r");
		$userPhoto->dbSave(["photo"=>$photo2]);
				
		// Test if edition was right
		$userPhoto2String = base64_encode($userPhoto->dbBlobLoad("photo"));
		if($userPhoto2String == $foto2Base64){
			print "- User {$user} photo was edited. SUCCESS<br>";
		}else{
			print "- User {$user} photo was edited. ERROR<br>";
		}
		print "END of BLOB tests<br/><br/>";
		
		// Delete user
		$user->dbDelete();
		// Delete user photo
		$userPhoto->dbDelete();
	}
	
	
	/**
	 * Tests del método dbLoad.
	 */
	public static function dbLoad_tests(){
		
		$user = static::create_default_user($userData=null);
		print "Tests for DBLOAD<br/>";
		$numTags = 10;
		$prefix = "Tag ".static::create_unique_suffix();
		// Creamos 10 etiquetas etiqueta
		$i=0;
		while($i<$numTags){
			$hi = $i+1;
			$name = "TestTagName {$hi}";
			$description = $prefix." ".static::create_unique_suffix();
			$tagData = ["name"=>$name, "description"=>$description];
			$tagCleanedData = Tag::cleanCreation($tagData);
			$tag = Tag::factoryFromArray($tagCleanedData);
			$tag->dbSave();
			$i++;
		}
		
		// Get tags by dbLoadAll
		$loadedTags = Tag::dbLoadAll(["description" => ["like"=>"$prefix%"]], $order=null, $limit=null, $container="query");
		foreach($loadedTags as $loadedTag){
			$user->dbAddRelation("tags", $loadedTag);
			print " -".$loadedTag->str()."<br/>";
		}
		
		print "- Print tags 8 & 9:<br/>";
		print $loadedTags[7]->str()."<br/>";
		print $loadedTags[8]->str()."<br/>";
		
		print "Five tags:<br/>";
		// Use again dbLoadAll
		$loadedTags2 = Tag::dbLoadAll(["description" => ["like"=>"$prefix%"]], $order=null, $limit=[0, 5]);
		foreach($loadedTags2 as $loadedTag){
			print " -".$loadedTag->str()."<br/>";
		}
		
		// Tags for the $user
		$tags = $user->dbLoadRelated("tags", $remoteCondition=[], $order=["name"=>"asc"], $limit=null, $container="queryresult");
		if($tags->count() == $loadedTags->count()){
			print "- Tags are associated with user corretly. SUCCESS<br>";
		}else{
			print "- Tags are not associated with user corretly. {$tags->count()} != {$loadedTags->count()}. ERROR<br>";
		}
		
		// Test if tags are created successfully
		$tags = Tag::objects()->filter(["description__startswith" => $prefix]);
		if($numTags == $tags->count()){
			print "- There are {$numTags} tags created with {$prefix} prefix. SUCCESS.<br>";
		}else{
			print "- There are {$tags->count()} tags created with {$prefix} prefix instead of {$numTags} tags. ERROR.<br>";
		}
		
		print "END tests for DBLOAD<br/><br/>";
	}
	
